    //Sqrt function 
    function sqrt(uint x) public pure returns(uint) {
        uint z = (x + 1 ) / 2; uint y = x; 
        while(z < y)
            { 
                y = z; 
                z = ( x / z + z ) / 2; 
            } 
        return y; 
    }
